description:
Verenigde Staten
Horror / Mystery
82 minuten

geregisseerd door Jack Gastelbondo
met Jessica Duffy, Marty Lindsey en David Dalton

Julianne en haar man trekken er op uit naar een hut. Maar de dingen zijn niet zo vreedzaam als ze gehoopt hadden. Julianne krijgt plots afschuwelijke visioenen waardoor ze aan haar geestelijke gezondheid begint te twijfelen. Waarom heeft ze dit nooit eerder gehad? Is het de hut die deze hele situatie uitlokt?



